  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Chincoteague
  National Wildlife Refuge outlines Refuge accomplishments from May through August
  of 1963. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, big game animals, furbearers, predators, rodents, mammals, raptors, fish,
  reptiles, and disease- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, and vegetation control. Resource management
  is outlined; topics include grazing. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, hunting, and
  safety. Items of interest, N-R forms, and photographs are included.\",\n\t\"owner_org\":
